// src/Sidebar.jsx
import { Stethoscope, Users, CalendarDays, FileText } from "lucide-react";

export default function Sidebar() {
  return (
    <aside className="w-64 bg-blue-900 text-white min-h-screen p-5">
      <ul className="space-y-4">
        <li className="flex items-center gap-3 cursor-pointer hover:text-yellow-400">
          <Stethoscope className="w-5 h-5" /> Doctors
        </li>
        <li className="flex items-center gap-3 cursor-pointer hover:text-yellow-400">
          <Users className="w-5 h-5" /> Patients
        </li>
        <li className="flex items-center gap-3 cursor-pointer hover:text-yellow-400">
          <CalendarDays className="w-5 h-5" /> Appointments
        </li>
        <li className="flex items-center gap-3 cursor-pointer hover:text-yellow-400">
          <FileText className="w-5 h-5" /> Prescriptions
        </li>
      </ul>
    </aside>
  );
}
